import React from 'react';
import { FaBars} from 'react-icons/fa'

const Sidebar = () => {
    const sideBaritems = [
        {
            path:"/Home",
            name:"home",
            //icon:<FaHome/>
        },
        {
            path:"/Project_Status",
            name:"ProjectStatus",
            
        },
        {
            path:"/Update_Employee",
            name:"updateEmployee",
            
        },
        {
            path:"/Remove_Employee",
            name:"RemoveEmployee",
            //icon:<AiFillDelete/>
        },
    ]
  return(
    <div className='container'>
        <div className='sidebar'>
            <div className='top'>
                <div className='bars'>
                    <FaBars/>
                <h1 className='Kaavian'>KAVN</h1>
                </div>
            </div>
        </div>
      
    </div>
  )
}

export default Sidebar;
